 cyclase 1 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q08828
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) mutations cause recessive hearing impairment in humans and defects in hair cell function and hearing in zebrafish . DB02527 ( DB02527 ) production , which is important for mechanotransduction within the inner ear , is catalyzed by adenylate cyclases ( AC ) . However , knowledge of the role of ACs in hearing is limited . Previously , a novel autosomal recessive non-syndromic hearing impairment locus DFNB 44 was mapped to chromosome 7p14 . 1 - q11 . 22 in a consanguineous family from Pakistan . Through whole-exome sequencing of DNA samples from hearing-impaired family members , a nonsense mutation c . 3112C &gt; T ( p . Arg 1038 * ) within adenylate cyclase 1 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q08828
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) was identified . This stop-gained mutation segregated with hearing impairment within the family and was not identified in ethnically matched controls or within variant databases . This mutation is predicted to cause the loss of 82 amino acids from the carboxyl tail , including highly conserved residues within the catalytic domain , plus a calmodulin-stimulation defect , both of which are expected to decrease enzymatic efficiency . Individuals who are homozygous for this mutation had symmetric , mild-to-moderate mixed hearing impairment . Zebrafish adcy 1b morphants had no FM1 - 43 dye uptake and lacked startle response , indicating hair cell dysfunction and gross hearing impairment . In the mouse , Adcy 1 expression was observed throughout inner ear development and maturation .

<h2 style="margin: 0">5</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">RNA-seq reveals determinants of sensitivity to chemotherapy drugs in esophageal carcinoma cells . Chemotherapy remains the mainstay of treatment for patients with incurable disease of esophageal carcinoma . Most patients respond poorly to chemotherapy , it is necessary to figure out biomarkers for chemotherapy sensitivity or resistance to perform the individualized therapy . In present work , the sensitivities of two ESCC cell lines to 9 chemotherapy drugs were identified and the transcriptome of these two cell lines were investigated by RNA-seq , the correlation between the sensitivity to drugs and expression of some genes was attempted to construct . Eca - 1 was more resistant to most of the chemotherapy drugs than Eca - 109 cell line . RNA-seq results showed that there is dramatic difference in the basal expression between these two ESCC cell lines . Pathway analysis demonstrated that these differentially expressed genes were mainly enriched in Gi signaling , calcium signaling , DB02527 - mediated signaling , G-protein coupled receptor signaling and actin cytoskeleton signaling pathways . The molecules in Gi signaling ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q08828

</mark>
 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P32745
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) and actin cytoskeleton signaling ( P13533 and P12883 ) were highly expressed in multidrug-resistant Eca - 1 cells , which were validated by quantitative PCR . Activation of these two pathways results in the upregulation of downstream signaling , PKA signaling and Src - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P40763
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , and downregulation of RAF - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29323

 signaling , which was validated by immunoblotting experiments . Our work proposed that activation of Gi signaling or actin cytoskeleton signaling may confer ESCC cells resistance to most chemotherapy drugs . Our work might provide potential biomarkers and therapeutic targets for treatment of EC patients .</div>

<h2 style="margin: 0">8</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">The design and development of pegfilgrastim ( PEG-rmetHuG - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04141
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , Neulasta ) . Recombinant protein technology produces drugs for human therapy in unprecedented quantity and quality . Research is now focusing on the relationship between pharmacokinetic and pharmacodynamic properties of molecules , with the aim of engineering proteins that possess enhanced therapeutic characteristics in contrast to being used as simple replacements for the natural equivalent . The addition of a polyethylene glycol ( PEG ) moiety to filgrastim ( rmetHu - DB00099 , Neupogen ) resulted in the development of pegfilgrastim . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00019
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 is a long-acting form of filgrastim that requires only once-per-cycle administration for the management of chemotherapy-induced neutropenia . The covalent attachment of PEG to the N-terminal amine group of the parent molecule was attained using site-directed reductive alkylation . Pegylation increases the size of filgrastim so that it becomes too large for renal clearance . Consequently , neutrophil-mediated clearance predominates in elimination of the drug . This extends the median serum half-life of pegfilgrastim to 42 hours , compared with between 3.5 and 3.8 hours for DB00099 , though in fact the half-life is variable , depending on the absolute neutrophil count , which in turn reflects of the ability of pegfilgrastim to sustain production of those same cells . The clearance of the molecule is thus dominated by a self-regulating mechanism . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00019
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 retains the same biological activity as filgrastim , and binds to the same 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q99062
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , stimulating the proliferation , differentiation and activation of neutrophils . Once-per-chemotherapy cycle administration of pegfilgrastim reduces the duration of severe neutropenia as effectively as daily treatment with filgrastim . In clinical trials , patients receiving pegfilgrastim also had a lower observed incidence of febrile neutropenia than patients receiving filgrastim .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Carboxyl-terminal parathyroid hormone fragments : role in parathyroid hormone physiopathology . PURPOSE OF REVIEW : Carboxyl-terminal parathyroid hormone ( C-PTH ) fragments constitute 80 % of circulating PTH . Since the first 34 amino acids of the PTH structure are sufficient to explain PTH classical biological effects on the type I PTH / 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 receptor and since C-PTH fragments do not bind to this receptor , they have long been considered inactive . Recent data suggest the existence of a C-PTH receptor through which C-PTH fragments exert biological effects opposite to those of human 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05829

</mark>
 on the type I PTH / 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P12272
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 receptor . This is why a lot of attention has been paid to these fragments recently . RECENT FINDINGS : In vivo , synthetic C-PTH fragments are able to decrease calcium concentration , to antagonize the calcemic response to human PTH ( 1-34 ) and human 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05829
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 and to decrease the high bone turnover rate induced by human 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05829
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 . In vitro , they inhibit bone resorption , promote osteocyte apoptosis and exert a variety of effects on bone and cartilaginous cells . These effects are opposite to those of human 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05829
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 on the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q03431
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 . This suggests that the molecular forms of circulating PTH may control bone participation in calcium homeostasis via two different receptors . Clinically , the accumulation of C-PTH fragments in renal failure patients may cause PTH resistance and may be associated with adynamic bone disease . Rare parathyroid tumors , without a set point error , overproduce C-PTH fragments . The implication of C-PTH fragments in osteoporosis is still to be explored . SUMMARY : C-PTH fragments represent a new field of investigation in PTH biology . More studies are necessary to disclose their real importance in calcium and bone homeostasis in health and disease .</div>

<h2 style="margin: 0">20</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">A randomised , double-blind study comparing lumiracoxib with naproxen for acute musculoskeletal pain . BACKGROUND : Some selective cyclooxygenase - 2 (

 ) inhibitors have been shown to provide analgesic efficacy in patients with acute pain . AIM : To compare the efficacy and safety of the

 inhibitor lumiracoxib 400 mg once daily ( qd ) and naproxen 500 mg twice daily ( bid ) in patients with acute musculoskeletal pain caused by uncomplicated soft tissue injury . METHODS : This was a randomised , double-blind , parallel-group , non-inferiority study set in 39 primary care centres in the UK . Patients were randomised to lumiracoxib 400 mg qd or naproxen 500 mg bid and took the study medication for as long as they felt that it was needed , up to day 7 . The primary efficacy analysis was the sum of the pain intensity difference ( 0-100 mm visual analogue scale ) determined morning and evening over the first 5 days of treatment ( SPID - 5 ) . RESULTS : The intention-to-treat population comprised 406 patients [ lumiracoxib 400 mg qd ( n = 207 ) ; naproxen 500 mg bid ( n = 199 ) ] . Both treatments were effective in reducing pain intensity over 5 days . The mean SPID - 5 scores were 117.0 mm.day for lumiracoxib and 118.2 mm.day for naproxen [ the treatment difference based on adjusted means from the ANCOVA was -2.78 mm.day , 95 % confidence interval ( CI ) -17.4 , 11.9 ] . The lower margin of the 95 % CI was above the predetermined non-inferiority margin ( - 50 mm.day ) for SPID - 5 , indicating non-inferiority of lumiracoxib compared with naproxen . Both treatments were well tolerated . CONCLUSION :
